import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Button, StyleSheet, Text, View, TouchableOpacity ,TouchableHighlight} from 'react-native';
import { createAppContainer } from 'react-navigation';
import { createStackNavigator } from 'react-navigation-stack';
import AuthServices from './AuthServices';
import As from './AuthServices';

export default class homepage extends React.Component {
    state = {
        em: this.props.navigation.state.params.n1,
    }
    

    constructor(props) {
        super(props);
        //this.buttonPressSlot = this.buttonPressSlot.bind(this);
        this.buttonPressmyprof = this.buttonPressmyprof.bind(this);
        this.buttonPressabout = this.buttonPressabout.bind(this);
        this.buttonLogout = this.buttonLogout.bind(this);
        this.buttonbooking = this.buttonbooking.bind(this);
    }
    buttonPress() {
        this.props.navigation.navigate('desti',{n2:this.state.em});
    }

    buttonPressmyprof() {
        console.log('called');
        this.props.navigation.navigate('myprof');
    }
    buttonPressabout() {
        console.log('called');
        this.props.navigation.navigate('Aboutu');
    }
    buttonLogout() {
        As.logOut()
            .then(() => {
                console.log('Sign-out successful');
                this.props.navigation.navigate('loginpg');
            }).catch((error) => {
                console.log(error);
            });
    }
    buttonbooking() {
        console.log('called');
        this.props.navigation.navigate('booki');
    }

    render() {

        const buttonStylesubmit = {
            color: "#FFFFFF",
            backgroundColor: "#008484",
            paddingBottom: 17,
            paddingTop: 3,
            paddingRight: 18,
            paddingLeft: 18,
            //fontFamily: "calibri",
            //textalign: 'center',
            fontSize: 200,
            fontWeight: 900,
            justifyContent: "center",
            alignItems: "center",
            marginRight: 50,
            height: 80,
            width: 180,
            borderWidth: 10,
            borderColor: "#FFFFFF",
            marginLeft: 125,
            marginBottom: 40
        }
        

        return (
            <View style={styles.container}>
                <View style={styles.RectangleShapeView}>
                    <Text style={styles.textHeading}>Home</Text>
                </View>
                <View style={styles.RectangleShapeout}>
                
                        <TouchableHighlight
                           style={styles.button}
                            underlayColor="white"
                            onPress={this.buttonPress}
                        > 
                            <Text style={styles.buttonText}>Book My Slot</Text>
                        </TouchableHighlight><View style={styles.space} />
                        
                    
                    <View>
                    <TouchableHighlight
                           style={styles.button}
                           
                            underlayColor="white"
                            onPress={this.buttonPressmyprof}
                        >
                            <Text style={styles.buttonText}>My Profile</Text>
                        </TouchableHighlight>
                        <View style={styles.space} />
                        
                    </View>
                    <View>
                    <TouchableHighlight
                           style={styles.button}
                            underlayColor="white"
                            onPress={this.buttonPressabout}
                        >
                            <Text style={styles.buttonText}>About Us</Text>
                        </TouchableHighlight>
                    
                        </View>
                        <View>
                    <TouchableHighlight
                           style={styles.button}
                            underlayColor="white"
                            onPress={this.buttonbooking}
                        >
                            <Text style={styles.buttonText}>My Booking</Text>
                        </TouchableHighlight>
                    
                        </View>

                </View>
                <View style={styles.RectangleShapedown}></View>
            </View>
        );
    }
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#FFFFFF',
        alignItems: 'center',
        justifyContent: 'center'
    },
    RectangleShapeView: {

        marginTop: -100,
        width: 400,
        height: 100,
        backgroundColor: '#008484',
        //marginBottom: 5,
        //textAlign: "center",
    },
    RectangleShapeout: {

        marginTop: 80,
        width: 400,
        height: 150,
        backgroundColor: '#FFFFFF',
        marginBottom: 5,
        //textAlign: "center",
        
        //borderWidth:6,
        //borderColor:'#008484'
    },
    RectangleShapedown: {

        width: 400,
        height: 100,
        marginTop:250,
        backgroundColor: '#008484',
        //textAlign: "center",
        //marginBottom:120
    },
    textHeading: {
        color: "#FFFFFF",
        fontSize: 40,
        marginLeft:145,
        fontWeight: "bold",
        justifyContent: "center",
        alignItems: "center",
        marginBottom:90,
        //fontFamily: "calibri",
        paddingTop: 30,
    },
    buttonText: {
        fontSize: 20,
        fontWeight: "bold",
        color: '#111',
        alignSelf: 'center',
        color: '#ffffff',
        alignItems: "center",
        justifyContent: "center",
    },
    button: {
        height: 70,
        alignItems: "center",
        justifyContent: "center",
        width:"50%",
        flexDirection: 'row',
        backgroundColor: '#008484',
        borderColor: 'white',
        borderWidth: 1,
        borderRadius: 8,
        //marginBottom: 10,
        marginTop: 20,
        borderWidth: 6,
        marginLeft:100,
        borderColor: "#FFFFFF",
        color: '#008484',
    },
    space: { 
        width: 20, 
        height: 20,
     },
});
